import { Link } from "react-router-dom"

const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Some event'
    },
    {
        id: 'e2',
        title: 'Another event'
    }
]

export default function EventsPage () {
    return (
        <>
            <h1>EventsPage</h1>
            <ul>
                {DUMMY_EVENTS.map(event => (
                    <li key={event.id}>
                        <Link to={`/events/:${event.id}`}>event.title{}</Link>
                    </li>
                ))}
            </ul>
        </>
    )
}
